import React from 'react'

const Home = () => {
  return (
    <div className="home-page mt-4">
      <p>You know 2500 characters.</p>
      <div class="progress">
        <div class="progress-bar" role="progressbar" style={{width: `${10/3000}`}} aria-valuenow="25" aria-valuemin="0" aria-valuemax="100">10</div>
      </div>
    </div>
  )
}

export default Home
